import './App.css';
import Title from './Title';
import NavBar from './NavBar';
import Body from './Body';

import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Title />
      <NavBar/>
      <Body/>
      <header className="App-header">

      </header>
    </div>
  );
}

export default App;
